import React from 'react'
import Error from './Error';

function Input(props) {
    return (

     <div>
       <label className="text-sm font-medium leading-none text-gray-800">{props.label}</label>
       <Error name={props.label} />        
        <input type={props.type} className="bg-gray-200 border rounded focus:outline-none text-xs font-medium leading-none text-gray-800 py-3 w-full pl-3 mt-2" value={props.value}/>
     </div>

    );
}

export default Input
